syntax = "proto2";

package v3.fingerprint.ip.v4.library;

message Message {
  optional string host = 1;
  optional string mask = 2;
  optional int32 version = 3 [default = 4];
  optional string library_type = 4;
  optional string library_name = 5;
  optional string library_version = 6;
  optional string detail = 7;
  optional string service =  8;
  optional uint32 port = 9;
  optional string protocol = 10;
}
